import React from 'react'
import './portfolio.css'
import PGraph from './PGraph'
import PTotal from './PTotal'

const Portfolio = () => {
    return(
        <div className='Portfolio'>
            <PTotal />
            <PGraph />
        </div>
    )
}

export default Portfolio
